import React, { useState } from "react";

function SearchUsers() {
  const [userId, setUserId] = useState();
  return (
    <div>
      <h1>Search Users</h1>
      <div>
        <input type="text" placeholder="Enter User Id" />
        <button>Fetch User</button>
      </div>
    </div>
  );
}

export default SearchUsers;
